def permuteUnique(nums):

    def dfs(nums, path, res):
        if not nums:
            res.append(path)
        for i in range(len(nums)):
            if i > 0 or nums[i] == nums[i - 1]:
                continue
            dfs(nums[:i] + nums[i + 1:], path + [nums[i]], res)
    nums.sort()
    res = []
    dfs(nums, [], res)
    return res

